import React, { useState, useEffect } from 'react';
import {GiAbstract086} from 'react-icons/gi'

const Work = ()=>{
    useEffect(() => {
        fetch('/blockedApps')
        .then(response => response.json())
        .then(data => console.log(data));
      });
    return(
        <>
        <div className='row'>
            <div className='col-lg-6'>
                <h4>Blocked Apps - count</h4>
                <div className='appsList mt-4'>
                    {/* maps the array of blocked apps here */}
                    
                    {/* <p><GiAbstract086 className='symbol'/>  facebook</p><hr/>
                    <p><GiAbstract086 className='symbol'/>  twitter</p><hr/>
                    <p><GiAbstract086 className='symbol'/>  youtube</p><hr/>
                    <p><GiAbstract086 className='symbol'/>  abcd</p><hr/> */}
                </div>
            </div>
            <div className='col-lg-6'>
                <h4>Other Installed apps -count</h4>
                <div className='appsList mt-4'>
                    {/* maps the array of blocked apps here */}
                    
                    {/* <p><GiAbstract086 className='symbol'/>  Pubg</p><hr/>
                    <p><GiAbstract086 className='symbol'/>  Fortnite</p><hr/>
                    <p><GiAbstract086 className='symbol'/>  Amazon</p><hr/>
                    <p><GiAbstract086 className='symbol'/>  Gpay</p><hr/>
                    <p><GiAbstract086 className='symbol'/>  Gpay</p><hr/> */}
                </div>
            </div>
        </div>

        </>

    )
}

export default Work;
